import React from 'react';
import { useState } from 'react';
import { supabase } from './supabaseClient'; // Assuming supabase is initialized here
import logo from './icons/logo.png'

const Navbar = ({ handleLogout }) => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  return (
    <nav style={styles.navbar}>
      <h1 style={styles.logo}>
        <img src={logo} alt="Logo" style={{ width: '200px', height: '50px' }} />
      </h1>
      <div style={{ position: 'relative' }}>
        <button onClick={toggleDropdown} style={styles.dropdownButton}>
          Account â–¼
        </button>

        {dropdownOpen && (
          <div style={styles.dropdownMenu}>
            <button onClick={handleLogout} style={styles.dropdownItem}>Logout</button>
            {/* Additional options can be added here if needed */}
          </div>
        )}
      </div>
    </nav>
  );
};

// Add some basic styles for your navbar
const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 20px',
    backgroundColor: '#dff5c1',
    color: 'white',
  },
  logo: {
    fontSize: '12pxpx',
  },
  logoutButton: {
    backgroundColor: 'white',
    color: '##dff5c1',
    padding: '8px 16px',
    borderRadius: '5px',
    border: 'none',
    cursor: 'pointer',
  }
};

export default Navbar;
